import React, { useState } from 'react';
import { ShoppingCartOutlined, MenuOutlined } from '@ant-design/icons';
import '../../index.css';

const MyNavbar = () => {

    const [openMenu, setOpenMenu] = useState(false);

    return (
        <Navbar>
            <li>
                <a href="/">Home</a>
            </li>
            <li>
                <a href="/">Products</a>
            </li>
            <li>
                <a href="/">About</a>
            </li>
            <li>
                <a href="/"><ShoppingCartOutlined className="shopping-cart"/></a>
            </li>
        </Navbar>
            // {mobileMenu}
            // <a href="/"><ShoppingCartOutlined className="shopping-cart-mobile"/></a>
            // <a href="#" onClick={() => setOpenMenu(!openMenu)}><MenuOutlined className="mobile-navbar" /></a>
    );
}

const Navbar = (props) => {
    return(
        <div className="navbar">
            <div className="nav-logo">
                <a href="/">Bio Market</a>
            </div>
            <ul className="nav-links">{ props.children }</ul>
        </div>
    )
}
export default MyNavbar;
